import React, { useState } from "react";

const images = [
  "/rest-1.png",
  "/rest-2.png",
  "/rest-3.png",
  "/rest-4.png",
  "/rest-5.png",
  "/rest-6.png",
];

const Restaurant = () => {
  const [current, setCurrent] = useState(0);

  const prevSlide = () => {
    setCurrent(current === 0 ? images.length - 1 : current - 1);
  };

  const nextSlide = () => {
    setCurrent(current === images.length - 1 ? 0 : current + 1);
  };

  return (
    <div className="max-w-6xl mx-auto bg-white rounded-2xl shadow p-8 space-y-10">

      {/* TITLE & LOGO */}
      <div className="flex items-center gap-6">
        <img
          src="/restaurant.png"
          alt="Client Logo"
          className="w-24 h-24 rounded-xl object-contain"
        />
        <h1 className="text-3xl font-bold text-gray-900">
          Bhagayath Bawarchi Restaurant
        </h1>
      </div>

      {/* PROJECT DETAILS */}
      <div className="grid grid-cols-1 sm:grid-cols-4 gap-6">
        <Detail label="Duration" value="3 Weeks" />
        <Detail label="Category" value="Dynamic Website" />
        <Detail label="Domain" value="Restaurant" />
        <Detail
          label="Website"
          value={
            <a
              href="https://restaurant-frontend-gilt-chi.vercel.app/"
              target="_blank"
              rel="noreferrer"
              className="text-blue-600 hover:underline"
            >
              Visit Website
            </a>
          }
        />
      </div>

      <hr className="border-gray-300" />

      {/* DESCRIPTION */}
      <div>
        <h2 className="text-xl font-semibold text-gray-800 mb-3">
          Project Description
        </h2>

        <ul className="list-disc list-inside text-gray-600 space-y-2">
          <li>Full-stack restaurant menu management system</li>
          <li>Django REST APIs for categories and menu items</li>
          <li>React-based dynamic UI with filters and subcategories</li>
          <li>Veg / Non-Veg filtering support</li>
          <li>Scalable and easy-to-update architecture</li>
        </ul>
      </div>

      <hr className="border-gray-300" />

      {/* IMAGE CAROUSEL */}
      <div>
        <h2 className="text-xl font-semibold text-gray-800 mb-4">
          Project Images
        </h2>

        <div className="relative max-w-4xl mx-auto">
          <img
            src={images[current]}
            alt={`Restaurant Screenshot ${current + 1}`}
            className="rounded-xl shadow-lg w-full transition-all duration-500"
          />

          {/* Left Button */}
          <button
            onClick={prevSlide}
            className="absolute left-4 top-1/2 -translate-y-1/2 bg-white/80 hover:bg-white text-gray-800 px-3 py-2 rounded-full shadow"
          >
            ‹
          </button>

          {/* Right Button */}
          <button
            onClick={nextSlide}
            className="absolute right-4 top-1/2 -translate-y-1/2 bg-white/80 hover:bg-white text-gray-800 px-3 py-2 rounded-full shadow"
          >
            ›
          </button>

          {/* Dots */}
          <div className="flex justify-center gap-2 mt-4">
            {images.map((_, i) => (
              <span
                key={i}
                onClick={() => setCurrent(i)}
                className={`w-3 h-3 rounded-full cursor-pointer ${current === i ? "bg-gray-800" : "bg-gray-300"
                  }`}
              />
            ))}
          </div>
        </div>
      </div>

      <hr className="border-gray-300" />

      {/* VIDEO SECTION */}
      <div>
        <h2 className="text-xl font-semibold text-gray-800 mb-4">
          Video Preview
        </h2>

        <div className="aspect-video rounded-xl overflow-hidden max-w-3xl mx-auto bg-black">
          <video
            className="w-full h-full object-cover"
            controls
          >
            <source src="/rest.mp4" type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      </div>

    </div>
  );
};

const Detail = ({ label, value }) => (
  <div className="bg-gray-200 rounded-xl p-4">
    <p className="text-sm text-gray-700">{label}</p>
    <p className="font-semibold text-gray-800">{value}</p>
  </div>
);

export default Restaurant;
